import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './index.css';

function NotFound() {
  const navigate = useNavigate();

  useEffect(() => {
    const timer = setTimeout(() => {
      navigate('/welcome');
    }, 3000); // Redirect after 3 seconds

    return () => clearTimeout(timer);
  }, [navigate]);

  return (
    <div className="not-found-container">
      <h2 className="not-found-title">404 - Page Not Found</h2>
      <p className="not-found-message">The URL you are trying to access is not found or is incorrect.</p>
      <p className="not-found-redirect">Redirecting to the Welcome page in 3 seconds...</p>
    </div>
  );
}

export default NotFound;
